import React from 'react';
import { MDBAccordion, MDBAccordionItem } from 'mdb-react-ui-kit';

export default function Samuel() {

  return (
    <MDBAccordion className="accord" flush initialActive={1}>
      <MDBAccordionItem  collapseId={1} headerTitle='Accordion Item #1'>
      <a href="https://www.amazon.com/Nike-Metcon-Ankle-High-Cross-Trainer/dp/B005UWIY92/ref=as_li_ss_il?_encoding=UTF8&pd_rd_i=B005UWIY92&pd_rd_r=06fb654b-5e37-4bbb-b53b-97607f9df5f9&pd_rd_w=633cN&pd_rd_wg=x20RC&pf_rd_p=a07701e4-f565-442a-b97f-93ab23cbb7ef&pf_rd_r=VE85QE590ESY706VAC1P&refRID=VE85QE590ESY706VAC1P&linkCode=li3&tag=gfdsaasdfg&linkId=fc4c04a22660d439689a61b126111c8f&language=en_US" target="_blank" ><img border="0" src="//ws-na.amazon-adsystem.com/widgets/q?_encoding=UTF8&ASIN=B005UWIY92&Format=_SL250_&ID=AsinImage&MarketPlace=US&ServiceVersion=20070822&WS=1&tag=sgfdasd0&language=en_US" /></a><img src="https://ir-na.amazon-adsystem.com/e/ir?t=sd74jf46y-20&language=en_US&l=li3&o=1&a=B005UWIY92" width="1" height="1" border="0" alt="" />
      </MDBAccordionItem>
      <MDBAccordionItem collapseId={2} headerTitle='Accordion Item #2'>
      <iframe src="//rcm-na.amazon-adsystem.com/e/cm?o=1&p=12&l=ur1&category=electronics&banner=1RJ5QAT5B55ECPXSXB82&f=ifr&linkID=2d3368d172fcd10b8ed3aa45c5631637&t=coffeelove01a-20&tracking_id=coffeelove01a-20" width="300" height="250" scrolling="no" border="0" marginwidth="0" style="border:none;" frameborder="0" sandbox="allow-scripts allow-same-origin allow-popups allow-top-navigation-by-user-activation"></iframe>
      </MDBAccordionItem>
      <MDBAccordionItem collapseId={3} headerTitle='Accordion Item #3'>
        Anim pariatur cliche reprehenderit, enim eiusmod high life accusamus terry richardson ad squid. 3 wolf
        moon officia aute, non cupidatat skateboard dolor brunch. Food truck quinoa nesciunt laborum eiusmod.
        Brunch 3 wolf moon tempor, sunt aliqua put a bird on it squid single-origin coffee nulla assumenda
        shoreditch et. Nihil anim keffiyeh helvetica, craft beer labore wes anderson cred nesciunt sapiente ea
        proident. Ad vegan excepteur butcher vice lomo. Leggings occaecat craft beer farm-to-table, raw denim
        aesthetic synth nesciunt you probably haven't heard of them accusamus labore sustainable VHS.
      </MDBAccordionItem>
    </MDBAccordion>
  );
}
